import perfil from './imagens/perfil.jpg';
import pontos from './imagens/pontos.png';
import feed from './imagens/feed.jpg';

function Feed() {
  return (
    <>
      <div className="feed">
            <div className="foto1">
                <div className="infomacoes-perfil">
                    <div className="perfil-feed">
                        <img src={perfil} className="foto-perfil" alt="perfil" />
                        <h1>UserName</h1>
                    </div>     

                    <img src={pontos} className="pontos" alt="perfil" />
                </div>
                <img src={feed} className="foto-feed" />>
            </div>
      </div>
    </>
  );
}

export default Feed;
